import React from "react";

/* Check Icon */
const CheckIcon = () => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    width="20"
    height="20"
    viewBox="0 0 24 24"
    fill="none"
    stroke="currentColor"
    strokeWidth="2"
    strokeLinecap="round"
    strokeLinejoin="round"
    className="text-green-400 mt-1"
  >
    <path d="M22 11.08V12a10 10 0 1 1-5.93-9.14" />
    <polyline points="22 4 12 14.01 9 11.01" />
  </svg>
);

function BlueprintResults({ data = {}, onBack }) {
  const {
    suggestions = [],
    improvedResume = {},
    recommendedOpportunities = [],
  } = data;

  const {
    header = "",
    summary = "",
    experience = [],
    skills = "",
  } = improvedResume;

  return (
    <div className="p-4 md:p-8 text-white">
      <div className="max-w-7xl mx-auto">
        <div className="flex justify-between mb-8">
          <h2 className="text-3xl md:text-5xl font-bold text-cyan-300">
            Your AI Blueprint
          </h2>
          <button
            onClick={onBack}
            className="px-4 py-2 bg-white/10 rounded-md"
          >
            ← Start Over
          </button>
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-5 gap-8">
          {/* Resume */}
          <div className="lg:col-span-3 bg-black/50 p-6 rounded-xl">
            <h3 className="text-2xl font-bold text-purple-300 mb-4">
              ATS-Optimized Resume
            </h3>

            <div className="space-y-6 text-sm">
              {header && (
                <div className="border-b pb-4">
                  {header.split("\n").map((l, i) => (
                    <p key={i}>{l}</p>
                  ))}
                </div>
              )}

              {summary && (
                <div>
                  <h4 className="font-bold text-purple-300 mb-1">
                    Summary
                  </h4>
                  <p>{summary}</p>
                </div>
              )}

              {experience.length > 0 && (
                <div>
                  <h4 className="font-bold text-purple-300 mb-1">
                    Experience
                  </h4>
                  <ul className="list-disc ml-5">
                    {experience.map((e, i) => (
                      <li key={i}>{e}</li>
                    ))}
                  </ul>
                </div>
              )}

              {skills && (
                <div>
                  <h4 className="font-bold text-purple-300 mb-1">
                    Skills
                  </h4>
                  {skills.split("\n").map((s, i) => (
                    <p key={i}>{s}</p>
                  ))}
                </div>
              )}
            </div>
          </div>

          {/* Feedback */}
          <div className="lg:col-span-2 space-y-8">
            <div className="bg-black/50 p-6 rounded-xl">
              <h3 className="text-2xl font-bold text-cyan-300 mb-4">
                ATS Feedback
              </h3>
              {suggestions.length ? (
                <ul className="space-y-3">
                  {suggestions.map((s, i) => (
                    <li key={i} className="flex gap-2">
                      <CheckIcon /> <span>{s}</span>
                    </li>
                  ))}
                </ul>
              ) : (
                <p className="text-sm opacity-70">
                  No feedback available.
                </p>
              )}
            </div>

            <div className="bg-black/50 p-6 rounded-xl">
              <h3 className="text-2xl font-bold text-pink-300 mb-4">
                Recommended For You
              </h3>
              {recommendedOpportunities.length ? (
                recommendedOpportunities.map((o) => (
                  <div key={o.id} className="mb-4">
                    <h4 className="font-bold">{o.title}</h4>
                    <p className="text-xs opacity-70">{o.type}</p>
                    <a
                      href={o.url}
                      target="_blank"
                      rel="noreferrer"
                      className="text-sm text-pink-400"
                    >
                      Learn More →
                    </a>
                  </div>
                ))
              ) : (
                <p className="text-sm opacity-70">
                  No recommendations found.
                </p>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default BlueprintResults;
